const compressedWords = '';

const words = LZString.decompressFromBase64(compressedWords).split('|');

const wordListElementsHash = new Map();

words.forEach(function(wd) {
    const w = document.createElement('H4');
    w.class = 'word';
    w.innerText = wd;
    w.hidden = true;
    wordListElementsHash.set(wd, w);
    document.getElementById('list-content').appendChild(w);
});

function wordRegexFilter(regex) {
    return words.filter(s => s.match(regex));
}

function createListFromWords(wordList) {
    wordListElementsHash.forEach(function(key) {
        key.hidden = true;
    });
    wordList.forEach(function(w) {
        wordListElementsHash.get(w).hidden = false;
    });
}

function onClick() {
    const ele = document.getElementById('text-box');
    const reg = new RegExp(ele.value);
    createListFromWords(wordRegexFilter(reg));
}

document.getElementById('button').onclick = onClick;
